const routes = [
    {
        path: '/menu/pizza',
        content: 'Pizza'
    },
    {
        path: '/menu/drink',
        content: 'Drink'
    },
    {
        path: '/menu/dessert',
        content: 'Dessert'
    }
]

export default routes;
